import ReactDOM from "react-dom";

class Data extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render(){
        return(
            <p>SUBSCRIBED</p>
        );
    }

}

ReactDOM.render(<Data />, document.getElementById('root'));
export default Data;
